const movie1 = {
        "Title": "Amazing Spiderman Syndrome",
        "Year": "2012",
        "imdbID": "tt2586634",
        "Type": "movie",
        "Poster": "N/A"
}

const App = () => {
    const searchMovies = async (title) => {
        const response = await fetch (`${API_URL}&s=${title}`);
        const data = await response.json();

        console.log(data.Search);

    }

useEffect(()=> {
    searchMovies('Spiderman');
}, []);


    return (
        <div className='app'>
            <h1>MovieLand</h1>

